How to handle additional multer file uploads from a NodeJS API perspective?<p>I am building a NodeJS API that speaks to MongoDB. I can't figure out how to handle multer file uploads via the API properly. I have a PATCH route that handles any JSON params passed to it and updates a document according to specified Id. </p>

<p>PATCH route:</p>

<pre><code>app.route('/api/Vehicles/:vehicleId')
    .patch(upload.single('carFile'),clickHandler.updateId)
</code></pre>

<p>Document:</p>

<pre><code>{
    "carDoc": [
        "http://localhost:3000/uploadsVehicle/2019-06-21T08:13:04.068Z_X5.jpg",
        "http://localhost:3000/uploadsVehicle/2019-06-21T08:38:03.562Z_X5.jpg"
    ],
    "_id": "5d0a039e16bf91332d968b46",
    "carNum": "XXX325",
    "carManager": "Gzegorz Tomasevic",
    "insuranceExp": "2021-06-06T00:00:00.000Z",
    "__v": 0
}
</code></pre>

<p>The below function handles the PATCH requests perfectly fine, however as I now need to associate files to my mongo documents somehow, I have implemented that if a file is accessed by <code>req.file</code> then an array in the specified document which is <code>carDoc</code> is updated with a web link to the newly uploaded image/pdf/whatever. As you can see the below function checks if any files are being uploaded, executes the ops under if, and proceeds to execute an update for other fields in the document as I initially designed this to only handle PATCH requests. So if I want to upload a new file only and create a new link in the <code>carDoc</code> array I end up getting the 404 response as the <code>Vehicle.update</code> function does not see that I have pushed a new weblink into the <code>carDoc</code> array. Is there a way I can combine the two operations ($push and $set) so I can receive a single response which I could then handle properly? Thank you!</p>

<p>The request handler:</p>

<pre><code>// modify doc by id
this.updateId = function (req, res) {

  const id = req.params.vehicleId;
  const updateObject = req.body;

  // if a file is uploaded add path to existing carDoc array
  if (req.file) {

    Vehicle.findByIdAndUpdate({_id: id}, {$push: {carDoc: ["http://localhost:3000/" + req.file.path]}})
     .exec()
     .then()

  }

  // update and error handling
  Vehicle.update({_id: id}, {$set: updateObject })
     .exec()
     .then(doc =&gt; {
        console.log(doc);
        if (doc.n === 0) {
           res.status(404).json({message: "document you are trying to modify does not exist."})
        }
        else {
           res.status(200).json({message: id +" document successfully modified.", changes: updateObject})
        }
     })
     .catch(err =&gt; {
        res.status(500).json({
           error: err
        })
     });
};
</code></pre>

