Embed Field: Improving mongo aggregation to build bipartite graph<p>I've two collections containing employees and projects. Each project has an array of tags and each employee has an array of preferences, where each preference is an object with tag and score attributes (employee preferences have a score based on the order they have chosen them).</p>

<p>Example of employees:</p>

<pre><code>[{
    "name":"employee1",
    "preferences":[
        {
            "tag": "tag1",
            "score": 3
        },
        {
            "tag": "tag2",
            "score": 2
        }
    ]
},
{
    "name":"employee2",
    "preferences":[
        {
            "tag": "tag2",
            "score": 3
        },
        {
            "tag": "tag3",
            "score": 2
        }
    ]
}]
</code></pre>

<p>Example of projects:</p>

<pre><code>[{
    "name":"project1",
    "tags":["tag1", "tag2"]
},
{
    "name":"project2",
    "tags":["tag2", "tag3"]
}]
</code></pre>

<p>Desired output:</p>

<pre><code>[{
    "project": "project1",
    "employee": "employee1",
    "score": 5
},
{
    "project": "project2",
    "employee": "employee1",
    "score": 2
},
{
    "project": "project1",
    "employee": "employee2",
    "score": 2
},
{
    "project": "project2",
    "employee": "employee2",
    "score": 5
}]
</code></pre>

<p>I wrote this aggregation pipeline, which give me the desired output (not exactly the same, but is just matter of adding a projection stage):</p>

<pre><code>db.employees.aggregate([
  {
    '$unwind' : '$preferences'
  },
  {
    '$lookup' : {
      'from' : 'projects',
      'localField' : 'preferences.tag',
      'foreignField': 'tags',
      'as' : 'match'
    }
  },
  {
    '$group' :
      {
        '_id': {'project' : '$match.name', 'employee' : '$name' },
        'score' : { '$sum' : '$preferences.score' }
      }
  },
  {
    '$unwind': '$_id.project'
  },
  {
    '$group' :
      {
        '_id': {'project' : '$_id.project', 'employee' : '$_id.employee' },
        'score' : { '$sum' : '$score' }
      }
  }
])
</code></pre>

<p>Now this is a working solution, but I'm not sure it is the best one. I'm doing some tests with a variable number of documents, from 100 to 5000 for each collection, and I'm comparing it with a simple iterative approach using nested for cycles, and the result is that the iterative approach is actually faster and lighter (executes in less time, using less memory).
I thought that the aggregation would became better increasing the number of documents but it seems not. Do you have any suggestion to improve the pipe? Any ideas in general? Thank you in advance :)</p>; Answer: Thanks. So if I understand, the download request is probably triggered by a POST request. The header is therefore not sufficient, I also need the POST content.

